import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h1>Hoş Geldiniz!</h1>
      <p>İhtiyacınız olan ürünü seçin ve sipariş formunu doldurun.</p>
      <Link to="/siparis-formu">Sipariş Formu</Link>
    </div>
  );
};

export default Home;
